import React from 'react'
import './Home.css'
export default function Home() {
    var backgroundStyle = {
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundImage: "url(" + 'https://images.unsplash.com/photo-1491841550275-ad7854e35ca6?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1934&q=80' + ")"
    };

    return (
        <div className="Home">
            <div style={backgroundStyle}>

            <h1> Welcome to the MemLearn </h1>

            <h3>Repetitive, but promising!</h3>
            <h3>A simple & exciting Tool for learning new Languages</h3>
            </div>
        </div>
    )

}
